      <div className="todo">
        <h1>To Do List</h1>
        <div className="putData">
          <input type="text" 
            placeholder="Add The Items"
          />
          <button>X</button>
        </div>
        div.lists
          <i class="far fa-trash-alt"></i>
          <ul>
            <li>Buy an Apple</li>
          </ul>
      </div>

    </dov>
     
    </>
  )
}

export default App;
